import React, { useState } from 'react'

export default function UserView({ r }) {

    const [node, setNode] = useState(false)
    const [nodeList, setNodeList] = useState()

    const nodeClick = () => {
        setNode(!node)
        nodes()
    }

    const nodes = () => {
        for (let i = 0; i > r.nodes.length; i++) {
            return <li key={i}>
                {Object.keys(r.nodes)[i]}
            </li>
        }
    }

  return (
    <li className='user-view'>
        <div>
            Name: {r.name}
        </div>
        <div>
            E-mail: {r.email}
        </div>
        <button onClick={nodeClick}>Check Nodes</button>
        {/* {r.nodes} */}
        {node ? <>
            <ol>
                {nodeList}
            </ol>
        </>:<></>}
    </li>
  )
}
